// You can convert your logo to Base64 using a site like: https://www.base64-image.de/
const FARANUX_LOGO_BASE64 = "data:image/png;base64,"
class PdfGenerator {
    /**
     * Generates a PDF for an Inventory Transfer
     * @param {string} batchId - The transfer batch ID
     * @param {object} data - The transfer details data from the API
     */
    static async generateTransferPDF(batchId, data) {
        let jsPDF;
        let autoTable;

        try {
            jsPDF = require('jspdf').jsPDF;
            autoTable = require('jspdf-autotable');

            if (autoTable && typeof autoTable !== 'function' && autoTable.default) {
                autoTable = autoTable.default;
            }
        } catch (e) {
            throw new Error("PDF libraries missing. Please run: npm install jspdf jspdf-autotable");
        }

        const doc = new jsPDF();

        // --- Color Palette ---
        const primaryColor = [165, 28, 28];   // Faranux Red
        const darkText = [31, 41, 55];        // Slate 800
        const lightText = [107, 114, 128];    // Gray 500
        const borderColor = [229, 231, 235];  // Gray 200

        // Dynamic Status Color
        let statusColor = lightText;
        const statusStr = (data.status || '').toLowerCase();
        if (statusStr === 'completed') statusColor = [21, 128, 61];      // Green
        else if (statusStr === 'pending') statusColor = [217, 119, 6];   // Orange
        else if (statusStr === 'rejected' || statusStr === 'canceled') statusColor = [220, 38, 38]; // Red

        // --- 1. Document Header ---

        // Add Logo to Top Right
        try {
            if (FARANUX_LOGO_BASE64 && FARANUX_LOGO_BASE64.length > 100) {
                // Parameters: base64Data, ImageType, X, Y, Width, Height
                // Adjust width (40) and height (17) to match your logo's aspect ratio!
                doc.addImage(FARANUX_LOGO_BASE64, 'PNG', 156, 15, 40, 17);
            }
        } catch (e) {
            console.warn("Failed to load logo into PDF", e);
        }

        doc.setFontSize(24);
        doc.setFont("helvetica", "bold");
        doc.setTextColor(...primaryColor);
        doc.text("INVENTORY TRANSFER", 14, 22);

        doc.setFontSize(10);
        doc.setFont("helvetica", "normal");

        // Batch Info
        doc.setTextColor(...lightText);
        doc.text("Batch ID:", 14, 32);
        doc.setTextColor(...darkText);
        doc.setFont("helvetica", "bold");
        doc.text(batchId, 32, 32);

        // Date Info
        doc.setFont("helvetica", "normal");
        doc.setTextColor(...lightText);
        doc.text("Date:", 14, 38);
        doc.setTextColor(...darkText);
        doc.text(new Date(data.created_at).toLocaleDateString(), 25, 38);

        // Status Info
        doc.setTextColor(...lightText);
        doc.text("Status:", 14, 44);
        doc.setFont("helvetica", "bold");
        doc.setTextColor(...statusColor);
        doc.text(data.status.toUpperCase(), 28, 44);

        // Divider Line
        doc.setDrawColor(...borderColor);
        doc.setLineWidth(0.5);
        doc.line(14, 50, 196, 50);

        // --- 2. Addresses ---
        doc.setFontSize(10);
        doc.setFont("helvetica", "bold");
        doc.setTextColor(...primaryColor);
        doc.text("DISPATCHED FROM", 14, 60);
        doc.text("DELIVERED TO", 115, 60);

        doc.setFontSize(14);
        doc.setTextColor(...darkText);
        doc.text(data.from_location, 14, 67);
        doc.text(data.to_location, 115, 67);

        doc.setFontSize(10);
        doc.setFont("helvetica", "normal");
        doc.setTextColor(...lightText);
        doc.text(`Issuer: ${data.initiated_by}`, 14, 73);
        doc.text(`Receiver: ${data.approved_by || 'Pending'}`, 115, 73);

        // --- 3. Table Data ---
        const tableBody = data.items.map(i => [
            i.product_sku || '-',
            i.product_name,
            i.qty.toString(),
            i.received_qty !== null ? i.received_qty.toString() : '-',
            i.note || ''
        ]);

        autoTable(doc, {
            startY: 82,
            head: [['SKU', 'Product Name', 'Sent Qty', 'Received Qty', 'Notes']],
            body: tableBody,
            theme: 'striped',
            headStyles: {
                fillColor: primaryColor,
                textColor: [255, 255, 255],
                fontStyle: 'bold'
            },
            alternateRowStyles: {
                fillColor: [249, 250, 251]
            },
            bodyStyles: {
                textColor: darkText,
                lineColor: borderColor,
                lineWidth: 0.1
            },
            styles: {
                font: 'helvetica',
                fontSize: 10,
                cellPadding: 5
            },
            columnStyles: {
                0: { fontStyle: 'bold', textColor: lightText, cellWidth: 30 },
                1: { cellWidth: 70 },
                2: { halign: 'center', cellWidth: 25 },
                3: { halign: 'center', fontStyle: 'bold', cellWidth: 30 },
                4: { cellWidth: 'auto' }
            }
        });

        // --- 4. Signatures ---
        const finalY = doc.lastAutoTable.finalY + 40;

        doc.setLineWidth(0.5);
        doc.setDrawColor(...lightText);

        // Sender line
        doc.line(14, finalY, 75, finalY);
        doc.setFontSize(10);
        doc.setTextColor(...lightText);
        doc.text("Sender Signature", 14, finalY + 6);

        // Receiver line
        doc.line(115, finalY, 176, finalY);
        doc.text("Receiver Signature", 115, finalY + 6);

        // Footer
        doc.setFontSize(8);
        doc.setTextColor(156, 163, 175);
        doc.text("Generated securely by Faranux Inventory System", 14, 285);

        // --- 5. Save the PDF (Electron Fix) ---
        const pdfBlob = doc.output('blob');
        const blobUrl = URL.createObjectURL(pdfBlob);

        const a = document.createElement('a');
        a.href = blobUrl;
        a.download = `Transfer_${batchId}.pdf`;
        document.body.appendChild(a);
        a.click();

        document.body.removeChild(a);
        URL.revokeObjectURL(blobUrl);
    }
}

module.exports = PdfGenerator;